import React from "react";
import CytoscapeComponent from 'react-cytoscapejs';


class DiffTool extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        const {state} = this.props.location;
        console.log("This is the data recieved");
        console.log(state);


        const elements = [
            { data: { id: 'one', label: 'Node 1', style: {color: 'f123a'}}},
            { data: { id: 'two', label: 'Node 2' }},
            { data: { id: 'three', label: 'Node 3', style: {color: 'f123a'}}},
            { data: { id: 'four', label: 'Node 4' }},
            { data: { id: 'five', label: 'Node 5', style: {color: 'f123a'}}},
            { data: { id: 'six', label: 'Node 6' }},
            { data: { id: 'seven', label: 'Node 7', style: {color: 'f123a'}}},
            { data: { id: 'eight', label: 'Node 8' }},
            { data: { source: 'one', target: 'two', label: 'Edge from Node1 to Node2'} }
            ];
        const layout = { name: 'random' };
        return <CytoscapeComponent elements={elements} layout={layout} style={{width: "100%", height: "750px"}} />;
    }
}

export default DiffTool;
